import React, { Component } from 'react'
import dataSource from './DataSource'

class Blog extends Component {
    render() {
        return (
            <div>
                {
                            dataSource.map((item, index) => {
                                return <Route exact key={index} path='/blog' component={() => <Blog title={item.title} content={item.content} />} />
                            })
                        }
            </div>
        )
    }
}

export default Blog
